import Header from '../components/Header';
import RedBackdrop from '../components/RedBackdrop';
import fs from 'fs';
import path from 'path';

const Features = ({ mp4FileNames, test }) => {
	return (
		<React.Fragment>
			<span>
				<Header />
				<RedBackdrop />
			</span>
			{mp4FileNames.map((file) => <div>{file}</div>)}
			{test.map((num) => <div>{num}</div>)}
		</React.Fragment>
	);
};

export async function getStaticProps() {
	const mp4Path = path.join(process.cwd(), 'features', 'mp4');
	const mp4FileNames = fs.readdirSync(mp4Path);

	return {
		props: {
			mp4FileNames,
			test: [ 1, 2, 3 ]
		}
	};
}

export default Features;
